raw_question: Find the program which most number of students are enrolled in. List both the id and the summary. 
question_index: 539 
join_columns:
 - degree_program_id
groupby_columns:
 - degree_program_id
functions:
 - max
 - count
comment: |-
  SELECT T1.degree_program_id,
         T1.degree_summary_name
  FROM Degree_Programs AS T1
  JOIN Student_Enrolment AS T2 ON T1.degree_program_id = T2.degree_program_id
  GROUP BY T1.degree_program_id
  ORDER BY count(*) DESC
  LIMIT 1

